    components: {
      Product
    },

    mounted () {
      this.processProductVariantsData()
    },

    methods: {
      processProductVariantsData () {
        this.products.forEach((product, index) => {
          if(product.ss_product_data) {
            product.ssProductData = JSON.parse(product.ss_product_data.replace(/&quot;/g, '"')) || [];
            delete product.ss_product_data;

            product.ssProductData.forEach(data => {
              if(data.on_sale === 'true') {
                data.onSale = true
              } else {
                data.onSale = false
              }
              delete data.on_sale;
            });

            product.ssProductData.sort((a, b) => {
              if(a.onSale === b.onSale) {
                return a.sale_price - b.sale_price
              }
              return a.onSale ? -1 : 1;
            });
          }
          product.sortedSSProductData = product.ssProductData.slice(0,12);
        });
        this.processingProducts = false;
      }
    }
